import React from 'react';
import './Body.css';

function Body(props){
    return(
        <div>
            <div className="bodyEncabezado">
                <p>{props.tituloPractica}</p>
            </div>
            <div className="bodyEstilo">
                {props.arreglo.map(txt => <p>{txt}</p>)}
                {props.arreglo.map((e,index)=>
                <p key={index}>{index+1}{e}</p>)}
            </div>
            <div className="bodyPie">
                <input name="boton" type="button" onClick='alert("Im sofia, hello")'/>
            </div>
        </div>
    );
}

export default Body;
